__NUXT_JSONP__("/pages/covid-19-visiting-guidelines", (function(a,b,c,d,e){return {data:[{page:{_createdAt:"2021-05-11T21:57:12Z",_id:"cbd80660-070b-4209-9f6a-9e0ddca819eb",_rev:"URjfm6wF5VMDpvBGnFRpWY",_type:"page",_updatedAt:"2021-05-25T11:13:34Z",content:[{_key:"bc5a3686061f",_type:a,children:[{_key:"b9ca547cd1b80",_type:b,marks:["strong"],text:"It is our priority to ensure the safety of our visitors and staff. We require all visitors to comply with the following COVID-19 preventative measures:"}],markDefs:[],style:c},{_key:"cd5fcec25645",_type:a,children:[{_key:"d6ae46b9e8df0",_type:b,marks:[],text:"Visitors must stand 6 feet apart from staff and other visitors at all times.\n"}],level:d,listItem:e,markDefs:[],style:c},{_key:"3418984d4f6e",_type:a,children:[{_key:"baa24d098f33",_type:b,marks:[],text:"Visitors must wear masks.\n"}],level:d,listItem:e,markDefs:[],style:c},{_key:"7829fbca6786",_type:a,children:[{_key:"4f0ede094d3f",_type:b,marks:[],text:"Visitors must provide contact information when entering the gallery to aid in the Cityâ€™s contact tracing efforts.\n"}],level:d,listItem:e,markDefs:[],style:c},{_key:"479218f2abf6",_type:a,children:[{_key:"665c5af837f2",_type:b,marks:[],text:"Capacity in the gallery must not exceed 5 visitors at any time. Please wait outside for other guests to leave if capacity has been reached."}],level:d,listItem:e,markDefs:[],style:c},{_key:"a78e94f817f2",_type:a,children:[{_key:"cc72efe3fe76",_type:b,marks:[],text:"You cannot enter the gallery if any of the following conditions apply:"}],markDefs:[],style:c},{_key:"a458239d5c3a",_type:a,children:[{_key:"e8e655b54835",_type:b,marks:[],text:"You are experiencing any symptoms associated with COVID-19 including cough, shortness of breath or difficulty breathing, fever, chills, muscle pain or weakness, sore throat, or loss of taste or smell.\n"}],level:d,listItem:e,markDefs:[],style:c},{_key:"f635aabbaba0",_type:a,children:[{_key:"30ea0d6783fe",_type:b,marks:[],text:"You have in the last 14 days had any close contact with anyone who is either confirmed or suspected of being infected with COVID-19, including anyone who was experiencing or displaying any of the known symptoms."}],level:d,listItem:e,markDefs:[],style:c},{_key:"002214685122",_type:a,children:[{_key:"e0558d9f8979",_type:b,marks:[],text:"If you have any questions about our COVID-19 visiting guidelines, please feel free to contact us by phone or email at: (917) 409-0612 \u002F info@simonesubal.com"}],markDefs:[],style:c}],date:"2021-05-25",slug:{_type:"slug",current:"covid-19-visiting-guidelines"},title:"COVID-19 Visiting Guidelines"}}],fetch:{},mutations:[]}}("block","span","normal",1,"bullet")));